     <!-- m_editable region-id="editable-static-tag-U61881-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
     <div class="clearfix colelem shared_content" id="u61881-4" data-muse-uid="U61881" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u61881-4_content"><!-- content -->
      <p id="u61881-2">O Programa Longevidade é um programa de relacionamento com dicas e serviços que serão úteis para seu tratamento, fornecendo inclusive, descontos na compra de alguns medicamentos da Torrent Pharma prescritos pelo seu médico. Você ainda poderá obter informações sobre saúde e qualidade de vida neste site. É muito simples fazer parte deste programa, veja como funciona.</p>
     </div>
     <!-- /m_editable -->
     <div class="clearfix colelem shared_content" id="pu61883" data-content-guid="pu61883_content"><!-- group -->
      <div class="browser_width grpelem" id="u61883-bw">
       <div id="u61883"><!-- group -->
        <div class="clearfix" id="u61883_align_to_page">
         <!-- m_editable region-id="editable-static-tag-U61821-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
         <div class="clearfix grpelem" id="u61821-7" data-muse-uid="U61821" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc"><!-- content -->
          <p id="u61821-2">Verifique se o produto prescrito pelo seu médico consta da lista abaixo. Esses são os produtos participantes do Programa Longevidade:</p>
          <p id="u61821-3">&nbsp;</p>
          <p id="u61821-5">Neblock</p>
         </div>
         <!-- /m_editable -->
        </div>
       </div>
      </div>
