     <div class="clearfix colelem shared_content" id="pu61882" data-content-guid="pu61882_content"><!-- group -->
      <div class="browser_width grpelem" id="u61882-bw">
       <div id="u61882"><!-- group -->
        <div class="clearfix" id="u61882_align_to_page">
         <!-- m_editable region-id="editable-static-tag-U61817-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
         <div class="clearfix grpelem" id="u61817-4" data-muse-uid="U61817" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc"><!-- content -->
          <p>Seu médico prescreveu um medicamento que faz parte do Programa Longevidade. Tenha em mãos a receita, seu nome e número do CRM ou com o carimbo do seu médico.</p>
