     <div class="clearfix colelem shared_content" id="pu61835" data-content-guid="pu61835_content"><!-- group -->
      <div class="browser_width grpelem" id="u61835-bw">
       <div id="u61835"><!-- group -->
        <div class="clearfix" id="u61835_align_to_page">
         <!-- m_editable region-id="editable-static-tag-U61880-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
         <div class="clearfix grpelem" id="u61880-5" data-muse-uid="U61880" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc"><!-- content -->
          <p>Após o cadastro, você poderá fazer a compra do medicamento informando à farmácia o seu CPF. São mais de 47.000 pontos de venda no Brasil que podem <span id="u61880-2"><a class="nonblock nontext" href="/farmacias">ser consultados aqui.</a></span></p>
