     <!-- m_editable region-id="editable-static-tag-U61832-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" -->
     <div class="clearfix colelem shared_content" id="u61832-17" data-muse-uid="U61832" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u61832-17_content"><!-- content -->
      <p id="u61832-2">Recomendações</p>
      <p id="u61832-4">Observe atentamente o período de tratamento indicado pelo seu médico na prescrição. Respeite a prescrição do seu médico. Não tome medicamentos por conta própria.</p>
      <p id="u61832-5">&nbsp;</p>
      <p id="u61832-7">Validade</p>
      <p id="u61832-9">A Torrent Pharma reserva-se o direito de alterar ou interromper o programa Programa Longevidade a qualquer momento, sem aviso prévio.</p>
      <p id="u61832-10">&nbsp;</p>
      <p id="u61832-12">Dúvidas frequentes</p>
      <p id="u61832-14">Abaixo selecionamos as perguntas mais recorrentes recebidas em nossa central de atendimento. Utilize as caixas de seleção abaixo, e veja se a sua questão se encontra disponível em um delas.</p>
      <p id="u61832-15">&nbsp;</p>
     </div>
     <!-- /m_editable -->
     <ul class="AccordionWidget rounded-corners clearfix colelem" id="accordionu61841"><!-- vertical box -->
      <li class="AccordionPanel clearfix colelem" id="u61870"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U61873-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u61873-4" data-muse-uid="U61873" data-muse-type="txt_frame"><!-- content --><div id="u61873-3" class="shared_content" data-content-guid="u61873-3_content"><p id="u61873-2">☉ Qual é o desconto concedido?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u61871"><!-- group --><!-- m_editable region-id="editable-static-tag-U61872-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u61872-4" data-muse-uid="U61872" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u61872-4_content"><!-- content --><p>O desconto é concedido sobre o Preço Máximo ao Consumidor* e varia de acordo com o produto selecionado. O percentual exato do desconto é informado no final do cadastro. *O Preço Máximo ao Consumidor é determinado pelo Governo Federal.</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u61842"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U61845-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u61845-4" data-muse-uid="U61845" data-muse-type="txt_frame"><!-- content --><div id="u61845-3" class="shared_content" data-content-guid="u61845-3_content"><p>☉ Como faço para me cadastrar?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u61843"><!-- group --><!-- m_editable region-id="editable-static-tag-U61844-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link" --><div class="clearfix grpelem shared_content" id="u61844-4" data-muse-uid="U61844" data-muse-type="txt_frame" data-content-guid="u61844-4_content"><!-- content --><p>Cadastrar-se no Programa Longevidade é muito simples. Basta ter em mãos seus dados pessoais (nome, endereço e CPF) e os dados da receita médica (quando o produto exigir prescrição). Depois, basta preencher o formulário aqui e pronto! Seu CPF já estará validado para a compra em qualquer um dos 47.000 pontos de venda credenciados ao Programa Longevidade.</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u61866"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U61869-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u61869-4" data-muse-uid="U61869" data-muse-type="txt_frame"><!-- content --><div id="u61869-3" class="shared_content" data-content-guid="u61869-3_content"><p>☉ Onde posso comprar?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u61867"><!-- group --><!-- m_editable region-id="editable-static-tag-U61868-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u61868-4" data-muse-uid="U61868" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u61868-4_content"><!-- content --><p>O Programa Longevidade possui mais de 47.000 farmácias credenciadas. A lista completa pode ser consultada aqui</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u61850"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U61853-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u61853-4" data-muse-uid="U61853" data-muse-type="txt_frame"><!-- content --><div id="u61853-3" class="shared_content" data-content-guid="u61853-3_content"><p>☉ Por que não posso comprar em qualquer farmácia?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u61851"><!-- group --><!-- m_editable region-id="editable-static-tag-U61852-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u61852-4" data-muse-uid="U61852" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u61852-4_content"><!-- content --><p>O credenciamento de farmácias depende de uma série de fatores: desejo da farmácia em fazer parte da rede, condições técnicas, condições comerciais, entre outros fatores. Hoje, você pode encontrar o Programa Longevidade em mais de 47.000 farmácias no Brasil todo, incluindo-se as grandes redes.</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u61846"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U61847-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u61847-4" data-muse-uid="U61847" data-muse-type="txt_frame"><!-- content --><div id="u61847-3" class="shared_content" data-content-guid="u61847-3_content"><p>☉ Meu cadastro expira?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u61848"><!-- group --><!-- m_editable region-id="editable-static-tag-U61849-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u61849-4" data-muse-uid="U61849" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u61849-4_content"><!-- content --><p>Seu cadastro no programa não expira, mesmo que fique um tempo sem comprar e depois volte a adquirir o medicamento. No entanto, pode ocorrer do produto para o qual você está cadastrado sair do programa. Neste caso, não será mais possível comprá-lo por meio do Programa Longevidade.</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u61862"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U61863-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u61863-4" data-muse-uid="U61863" data-muse-type="txt_frame"><!-- content --><div id="u61863-3" class="shared_content" data-content-guid="u61863-3_content"><p>☉ Consigo efetuar a compra com desconto apenas com meu CPF?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u61864"><!-- group --><!-- m_editable region-id="editable-static-tag-U61865-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u61865-4" data-muse-uid="U61865" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u61865-4_content"><!-- content --><p>A Torrent do Brasil mudou a forma de identificação na farmácia. Você pode simplesmente mencionar o número do seu CPF ao balconista. Mais rápido e prático!</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u61858"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U61859-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u61859-4" data-muse-uid="U61859" data-muse-type="txt_frame"><!-- content --><div id="u61859-3" class="shared_content" data-content-guid="u61859-3_content"><p>☉ Preciso fazer um novo cadastro para aderir a outro produto?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent disn clearfix colelem" id="u61860"><!-- group --><!-- m_editable region-id="editable-static-tag-U61861-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u61861-4" data-muse-uid="U61861" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u61861-4_content"><!-- content --><p>Quando você faz um cadastro no Programa Longevidade, precisa informar o produto que tomará. Será liberada a compra desse produto apenas. Com uma nova prescrição, será necessário apenas informar os dados novos - produto e os dados do médico. Basta fazer o login aqui e acrescentar o novo medicamento. É muito fácil recuperar ou criar a sua senha!</p></div><!-- /m_editable --></div></li>
      <li class="AccordionPanel clearfix colelem" id="u61854"><!-- vertical box --><!-- m_editable region-id="editable-static-tag-U61857-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,clickable" --><div class="AccordionPanelTab borderbox transition clearfix colelem" id="u61857-4" data-muse-uid="U61857" data-muse-type="txt_frame"><!-- content --><div id="u61857-3" class="shared_content" data-content-guid="u61857-3_content"><p>☉ Por que nem todos os produtos estão no programa?</p></div></div><!-- /m_editable --><div class="AccordionPanelContent clearfix colelem" id="u61855"><!-- group --><!-- m_editable region-id="editable-static-tag-U61856-BP_infinity" template="programa_logado.html" data-type="html" data-ice-options="disableImageResize,link,txtStyleTarget" --><div class="clearfix grpelem shared_content" id="u61856-4" data-muse-uid="U61856" data-muse-type="txt_frame" data-IBE-flags="txtStyleSrc" data-content-guid="u61856-4_content"><!-- content --><p>Os produtos estão entrando gradativamente no Programa Longevidade e dependem de vários fatores. Visite regularmente o nosso website para saber quais produtos estão incluídos no programa.</p></div><!-- /m_editable --></div></li>
     </ul>
